INSERT INTO `Posts` VALUES ('#butt','cool','2014-12-11 01:13:14','a7b62c24-6e7f-4f64-98d2-d1eb6803f4c7'),('Bogarth','Hi, my name is Bogarth &amp; I like playing tic tac toe...','2014-12-08 02:25:18','7cd6d8a0-c1c2-4d11-9aa2-3f974310573b'),('Bogarth','Why do my messages keep vanishing from the chat log? They show up but then when I come back later they are gone!','2014-12-08 02:26:13','16c21b25-01bd-4b5e-a284-dce1f20a0b9c'),('Bogarth','Thanks for fixing it!','2014-12-09 05:18:20','16c21b25-01bd-4b5e-a284-dce1f20a0b9c'),('Cannon','Hello everyone!','2014-12-08 01:12:58','7cd6d8a0-c1c2-4d11-9aa2-3f974310573b'),('Duck_Follower','QUACK QUACK QUACK. QUACK QUACK QUACK? QUACK QUACK QUACK QUACK. QUACK QUACK QUACK QUACK QUACK. QUACK!?','2014-12-11 01:25:17','97d4e6a1-39d2-4301-b8d1-bb57648e1828'),('Duck_Follower','QUACK QUACK QUUUUUUUUUACK?!','2014-12-11 01:25:40','a7b62c24-6e7f-4f64-98d2-d1eb6803f4c7'),('Duck_Follower','QUACK QUACK QUACK QUACK. QUACK QUACK QUACK. QUACK!?','2014-12-11 01:26:28','7cd6d8a0-c1c2-4d11-9aa2-3f974310573b'),('Duck_Follower','QUACK','2014-12-11 01:27:01','16c21b25-01bd-4b5e-a284-dce1f20a0b9c'),('NickAllred','Say something nice to everyone!','2014-12-08 01:12:14','7cd6d8a0-c1c2-4d11-9aa2-3f974310573b'),('NickAllred','Special characters such as quotes, ampersands, etc... weren&#x27;t being properly escaped before being inserted into the database.  This caused a parsing error and the message never made it into the database.  The websocket, however, did emit the message.  So anyone connected with a websocket at the time you sent the message would have seen your message but anyone who requested messages from the database wouldn&#x27;t get your message because it never made it in there! =(','2014-12-08 02:28:37','16c21b25-01bd-4b5e-a284-dce1f20a0b9c'),('NickAllred','A new version of the Bot has been released.  You can view the stats to see that Bot2.0 beats Bot at about a 2-1 margin. Yay Bot2.0!','2014-12-10 05:05:01','45b94a4a-8a0f-4e47-9d35-2425913e5fd1'),('NickAllred','You&#x27;re welcome!','2014-12-10 20:47:56','16c21b25-01bd-4b5e-a284-dce1f20a0b9c');
